  input: TEXT,F3A,,"[Memo 1] Ann Eppard's in-kind contribution of event-related personal
    expenditures for invitations, food, and beverages on Sept. 22, 2003 was originally
    reported as $2,540.79. Since this amount exceeded the limit for the primary election,
    $2,000 was designated for the primary and the other $540.79 for the run-off, per
    FEC guidance. However, because reportable contributions do not include the first
    $1,000 of event-related personal expenditures, we are adjusting this number appropriately
    by designating the full reportable difference of $1,540.79 towards the primary
    election. [Memo 2] The date of the loan repayment (forgiveness) of $13,240, originally
    reported as 12/30/03, is more accurately reflected as 9/30/03 in this amended
    report. The personal, unreimbursed expenditures of the candidate evidenced by
    this payable (loan) were extinguished by payments directly to the credit card
    companies during the third quarter of 2003."
